import React,{useState} from 'react'

const Practice = () => {
    const [d,setData]=useState({name:"SKS",age:0,class:"CS-2",college:"GGCT"})
    const UPDATE=()=>{
        setData({...d,name:"Shreyash"})
    }
    return (
        <>
            <h1>Hello {d.name} age {d.age} class {d.class} college {d.college}</h1>
            <button onClick={UPDATE}>UPDATE</button>
        </>
    )
}
export default Practice
